INSERT INTO `pack_cards` VALUES ('above-question','core',1,'141','Stu Barnes','\"Excuse me, samurai-san, but you must be mistaken! It could not possibly have been her.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_141.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('adept-of-shadows','core',1,'180','Felipe Gaona','There are dozens of ways to hide, and only one way to be seen.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_180.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('adept-of-the-waves','core',1,'84','Jason Engle','\"Water is flexible and yielding, yet none can withstand the crashing waves.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_84.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('admit-defeat','core',1,'147','David Horne','It is not only a question of defeating one\'s opponents, but defeating them in such a manner that they know they have been beaten.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_147.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('against-the-waves','core',1,'177','Calvin Chua','Water is ever changing. A gentle wave one moment and a torrent of force the next.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_177.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('agasha-swordsmith','core',1,'56','Stanislav Dikolenko',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_56.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('aggressive-moto','core',1,'111','Polar Engine','Moto can die but cannot yield.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_111.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('akodo-gunso','core',1,'71','Polar Engine',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_71.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('akodo-toturi','core',1,'79','Shawn Ignatius Tan','A lion is more than his roar, his mane, his teeth, his heart. A lion is all of these.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_79.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('ambush','core',1,'188','Calvin Chua',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_188.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('ancestral-daisho','core',1,'151','Jason Juta',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_151.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('ancestral-lands','core',2,'15','Nele Diel','\"Our claim on these lands stretches back to the dawn of the Empire.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_15.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('artisan-academy','core',1,'53','Conceptopolis',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_53.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('asahina-artisan','core',1,'40','Alayna Lemmer',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_40.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('asahina-storyteller','core',1,'50','Caravan Studio',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_50.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('asako-diplomat','core',1,'85','Tony Foti',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_85.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('ascetic-visionary','core',1,'63','Conceptopolis',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_63.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('assassination','core',2,'203','Greg Lambrakis',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_203.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('banzai','core',2,'204','Troy Graham',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_204.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('bayushi-liar','core',1,'95','Diego Gisbert Llorens','\"I sincerely doubt that asking you to trust me will change your mind, and yet, I ask anyway.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_95.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('bayushi-manipulator','core',1,'96','Polar Engine','\"Victory does not always go to the strongest of two opponents.\" - Bayushi\'s Lies','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_96.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('bayushi-shoju','core',1,'107','Shawn Ignatius Tan and Le Vuong','\"Believing what is true is only sensible.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_107.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('bayushi-yunako','core',1,'105','Adam Schumpert',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_105.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('blackmail','core',1,'189','Charles Urbach',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_189.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('blackmail-artist','core',1,'98','Erich Schreiner','\"The real art lies in convincing your mark that you are bound, by duty and honor, to expose him. At which point, buying you off becomes his idea.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_98.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('blood-of-onnotangu','tears-of-amaterasu',3,'1','Kevin Zamir Goeke',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C02_1.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('border-rider','core',1,'112','Charles Urbach','Ride to the horizon and back again. Only then can you begin to comprehend the Unicorn.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_112.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('borderlands-defender','core',1,'31','Le Vuong','Even when faced with such hardship, the Crab Clan has never wavered, standing steadfast in its duty to protect the southern border of the Empire.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_31.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('borderlands-fortifications','core',1,'38','Noah Bradley',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_38.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('born-in-war','core',1,'194','Kevin Zamir Goeke',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_194.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('brash-samurai','core',1,'42','Calvin Chua','A samurai lives at all times three feet from death.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_42.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('breakthrough','core',1,'195','Sergio Camarena',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_195.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('calling-in-favors','core',1,'186','Carlos Palma Cruchaga',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_186.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('captive-audience','core',1,'196','Calvin Chua','\"Now you must heed our demands!\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_196.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('cautious-scout','core',1,'43','Sergio Camarena','They told him to be careful, but there was only one way to know for sure.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_43.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('cavalry-reserves','core',1,'199','Andy Hepworth',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_199.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('charge','core',2,'210','Niten','A samurai must always be ready. Ready to fight. And ready, if need be, to die.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_210.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('city-of-lies','core',1,'108','Chris Ostrowski','In Ryok&#333; Owari Toshi, koku could pave any road.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_108.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('city-of-the-open-hand','core',1,'6','Chris Ostrowski',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_6.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('city-of-the-open-hand','gen-con-2017',1,'13','Chris Ostrowski',NULL,NULL,'2017-11-11 17:58:10','2017-11-11 17:58:10'),('cloud-the-mind','core',2,'202','Veronica V. Jones',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_202.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('contingency-plan','core',2,'205','Filip Storch','\"The only thing that is certain is that something will go wrong.\" - Bayushi\'s Lies','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_205.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('court-games','core',2,'206','Shen Fei',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_206.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('court-mask','core',1,'182','Diego Gisbert Llorens',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_182.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('daidoji-nerishma','core',1,'46','Polar Engine','\"It\'s an ambush! Be ready!\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_46.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('daimyo-s-favor','core',1,'152','Lukas Banas',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_152.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('deathseeker','core',1,'72','Conceptopolis','\"I shall redeem my name in service to my clan!\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_72.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('defend-the-wall','core',1,'8','Chris Ostrowski',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_8.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('disdainful-remark','tears-of-amaterasu',3,'13','Tropa Entertainment',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C02_13.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('display-of-power','core',1,'179','Shen Fei',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_179.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doji-challenger','core',1,'47','Zezhou Chen','\"I hope you are prepared to defend your words with steel!\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_47.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doji-gift-giver','core',1,'44','Lukas Banas',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_44.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doji-hotaru','core',1,'52','Shawn Ignatius Tan','\"Were it not for the rule of k&#333;, we would be trapped in this game for eternity. We are nearly perfectly matched.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_52.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doji-representative','tears-of-amaterasu',3,'5','Eli Ring','\"I regret that I must decline your gracious invitation.\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C02_5.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doji-whisperer','core',1,'41','Kathryn Steele','\"Lean closer, that I might tell you something only the willows should hear...\"','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_41.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('doomed-shugenja','core',1,'54','Smirtouille',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_54.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('duelist-training','core',1,'142','Charles Urbach',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_142.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('eager-scout','core',1,'25','Diego Gisbert Llorens','The first to fight, the first to die.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_25.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('elemental-fury','core',2,'16','Calvin Chua',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_16.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('embrace-the-void','tears-of-amaterasu',3,'16','Pavel Kolomeyets',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C02_16.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('endless-plains','core',1,'14','Alayna Lemmer',NULL,'http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_14.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('enlightened-warrior','core',1,'60','Carlos Nuñez de Castro Torres','In heart, air.\nIn spirit, earth.\nIn sword, fire.\nIn body, water.\nIn mind, void.','http://lcg-cdn.fantasyflightgames.com/l5r/L5C01_60.jpg','2017-11-11 17:58:10','2017-11-11 17:58:10'),('entrenched-position','core',2,'17','Stanislav Dikolenko','\"It would take an entire Moto horde to break through here.\"','http://lcg-cdn.fantasyfligh